                        <h2>Booking History</h2>
                        <div className="history-table">



                            <div className="ticket">
                                <p>PNR : ABGHYO</p>
                                <p>Transcation ID : 12ER56HJ90LMX</p>
                                <p>Train Number : 12565</p>
                                <p>Train Name : Konasa Express</p>
                                <p>From : EKM</p>
                                <p>To : BLR</p>
                                <p> </p>

                            </div>


                        </div>
                    </div>




        )
    }
}

export default BookingHistory
